        <h5>Inline and Overlay</h5>
        <p>ColorPicker is displayed as an overlay with a preview option by default where second alternative is the inline mode.</p>
        <pre v-code><code>
&lt;ColorPicker v-model="color" :inline="true" /&gt;

</code></pre>

